import Navbar from "./components/Navbar";
import Login from "./components/Login"; 
import  Questions  from "./components/Questions";
import { Hamburger } from "./components/Hamburger";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";






function App() {
  return (
    <Router>
    <div>

  <Navbar />

  <Login />

    <Questions />
    <Hamburger/>

<div className="bot">

<p className="heading">Dive into the thrill of knowledge with our captivating quizzes. Click to Start Now!</p>
<button className="btn">Click here to Start</button></div>

<switch>
<Route path="navbar" component={Login} />

</switch>

  </div>
  </Router>

  );
}

export default App;
